import React from "react";

import { useParams } from "react-router-dom";
import TaskList from "../components/TaskList";
//import TaskList from "../../users/components/TaskList";

const DUMMY_TASKS = [
    {
        taskId : 't1',
        creator : 'Ananya Gupta',
        taskDesc : 'Study JavaScript',
        creatorId: 'c1'
    },
    {
        taskId : 't2',
        title : 'Dr. Mishra',
        taskDesc : 'Travel whole world',
        creatorId: 'c2'
    }
];

const CreatorTasks = () => {
    const creatorId = useParams().creatorId;
    const loadedTasks = DUMMY_TASKS.filter(tasks => tasks.taskId === taskId);
    return <TaskList items = {loadedTasks} />
   // return <TaskList items = {TASKS} />;
};

export default CreatorTasks;
